INSERT INTO `global_settings` VALUES ('membershipBenefits','{\"title\":\"Membership Benefits\",\"markup\":\"\\r\\n                  \\r\\n                  \\r\\n                  <p class=\\\"mt-2\\\">As a member of SHRUB you\'re now part of our community, have an equal voice in the co-op and the right to take part in decision making!</p>\\r\\n  <p>You also get:</p>\\r\\n<ul><li>Access to swap at the swapshop!</li><li>Use of the freeshop!</li><li>Use of the food sharing hub!</li><li>Discounts at paid events and workshops!</li><li>Discount on bike parts at the Wee Spoke Hub!</li><li>Discounted booking of our lovely spaces for personal use!</li><li>Come to our members parties!</li></ul>\\r\\n              \\r\\n              \\r\\n              \"}');
INSERT INTO `global_settings` VALUES ('ourVision','{\"title\":\"Our Vision\",\"markup\":\"<p>SHRUB Swap & Reuse Hub is a community-led co-operative working for a world without waste.</p>\\n\\n            <h5 class=\\\"mt-3 mb-1\\\">Our Purpose (Aims & Objectives)</h5>\\n            <div class=\\\"container\\\">\\n              <ol>\\n\\n                <li>To provide a welcoming space for rethinking our relationship to waste, reducing consumption and developing effective use of resources</li>\\n\\n                <li>To support community empowerment in Edinburgh, learning and sharing skills to make a practical difference to the world we share</li>\\n\\n                <li>To deliver innovative waste prevention, creative reuse and repair practices in a living laboratory of Circular Economy</li>\\n              </ol>\\n            </div>\\n            <h5 class=\\\"mt-4 mb-1\\\">Our Values</h5>\\n            <div class=\\\"container\\\">\\n              <ul style=\\\"list-style-type: disc;\\\">\\n                <li>We value inclusivity and work with others to provide a welcoming community for all</li>\\n\\n                <li>We act with integrity and strive to be sustainable in everything we do</li>\\n\\n                <li>We live by co-operative values of self-help, self-responsibility, democracy, equality, equity and solidarity.</li>\\n              </ul>\\n            </div>\"}');
INSERT INTO `global_settings` VALUES ('passwordReset','true');
INSERT INTO `global_settings` VALUES ('privacyNotice','{\"title\":\"Privacy Notice\",\"markup\":\"<span id=\\\"docs-internal-guid-693474d3-7fff-8c8b-82d1-7a5533b77169\\\">\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">SHRUB Coop </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">takes your privacy seriously. </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We never pass your personal data to anyone else.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">If you have any concerns, you have a right to:</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></p>\\r\\n   <ul>\\r\\n      <li style=\\\"line-height: 1.44; margin-top: 0pt; margin-bottom: 3pt;\\\"><span style=\\\"background-color: transparent; color: rgb(38, 38, 38); font-family: &quot;Open Sans&quot;; font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Request that we correct your personal data if you believe it is inaccurate/incomplete</span></li>\\r\\n      <li style=\\\"line-height: 1.44; margin-top: 0pt; margin-bottom: 3pt;\\\"><span style=\\\"background-color: transparent; color: rgb(38, 38, 38); font-family: &quot;Open Sans&quot;; font-size: 12pt; white-space: pre;\\\">Request that we delete your personal data</span></li>\\r\\n      <li style=\\\"line-height: 1.44; margin-top: 0pt; margin-bottom: 3pt;\\\"><span style=\\\"background-color: transparent; color: rgb(38, 38, 38); font-family: &quot;Open Sans&quot;; font-size: 12pt; white-space: pre;\\\">Change your communication preferences or restrict the processing of your personal data </span></li>\\r\\n   </ul>\\r\\n   <p style=\\\"list-style-type: disc; font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; margin-left: -3.85pt;\\\"></p>\\r\\n   <ul>\\r\\n      <li style=\\\"line-height: 1.44; margin-top: 0pt; margin-bottom: 6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Access the personal data that we hold about you through a “subject access request”.\\r\\n         </span>\\r\\n      </li>\\r\\n   </ul>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Please contact us at </span><a href=\\\"mailto:hello@shrubcoop.org\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(171, 12, 23); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\\\">hello@shrubcoop.org</span></a><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"> </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">for any of these purposes.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Under data protection legislation we are a “controller” of personal data you share with us. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This Privacy Policy provides notice on how and why we process your data and for how long we will keep your personal data, and where it is held. &nbsp;</span></p>\\r\\n   <br>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We retain your data in different ways depending on the application: </span></p>\\r\\n   <br>\\r\\n   <ol style=\\\"margin-top:0pt;margin-bottom:0pt;\\\">\\r\\n<h2 dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:12pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">1. SHRUB membership</span></h2>\\r\\n   </ol>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">What we do with your data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We use your data to provide both group and individual membership services, including e-newsletters, communications regarding relevant collaborations, events, SHRUB Coop proposals, and decisions etc. </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data held: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Name, address, phone number, email, type of membership, working group, start and end of membership. </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">The legal basis for processing data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Legitimate interest – as you have signed up. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Storage: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data is held in a password-protected database. Email addresses are also held on our mailing list (MailChimp) to enable us to circulate newsletter to contacts. &nbsp;Contributors to subgroups may be held in small email discussion groups held on specific service provider where used with agreement of each individual – to facilitate active collaboration. We only ever ask for the minimum amount of data for the associated purpose and delete that data promptly once it is no longer required. The information is stored in and accessed through our membership database which is called Murakami.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Retention: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We keep your personal data only to provide you with membership services. We update or delete your data on request or on termination of membership. &nbsp;</span></p>\\r\\n   <br>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">2. Volunteers</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">What we do with your data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We use your data to provide both group and individual membership services, including e-newsletters, communications regarding relevant collaborations, events, SHRUB Coop proposals, and decisions etc. </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data held: </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">If submitted</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"> </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">-</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"> </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Name, address, phone number, email, volunteer status (how frequently the member volunteers), availability, volunteer roles, skills, hobbies and interest, relevant experience, relevant training, preferred method of communication, emergency contact (relation to volunteer, phone number), hours volunteered, working group</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">The legal basis for processing data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Legitimate interest – as you have signed up. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Storage: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data is held in a password-protected database. Email addresses are also held on our mailing list (MailChimp) to enable us to circulate newsletter to contacts. &nbsp;Contributors to subgroups may be held in small email discussion groups held on specific service provider where used with agreement of each individual – to facilitate active collaboration. We only ever ask for the minimum amount of data for the associated purpose and delete that data promptly once it is no longer required. The information is stored in and accessed through our membership database which is called Murakami.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Retention: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We keep your personal data necessary for your volunteer involvement with SHRUB Coop. We update or delete your data on request or on termination of membership. &nbsp;</span></p>\\r\\n   <br>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">3. Mailing list subscribers</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">What we do with your data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We send you an e-newsletter and other occasional mailings about relevant events or projects.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data held: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">First name, Last name, email, phone number.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">The legal basis for processing data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Legitimate interest – as you have signed up. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Storage: </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data is held on our newsletter list (MailChimp) with password protection. We only ever ask for the minimum amount of data for the associated purpose and delete that data promptly once it is no longer required.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Retention: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We will keep you on this mailing list until you request amendment or deletion. You can unsubscribe any time you want.</span></p>\\r\\n   <br>\\r\\n   <h2 dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:12pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">4. Swapshop users</span></h2>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">What we do with your data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We use your data for purposes of accountancy.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Data held: </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Status, balance, transactions (date, amount, sub-total for each item category, the weight of items, an optional comment</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">The legal basis for processing data: &nbsp;</span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Accountancy, financial evaluation.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Storage: </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">The information is stored in and accessed through our membership database which is called Murakami. We only ever ask for the minimum amount of data for the associated purpose and delete that data promptly once it is no longer required.</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Retention: </span><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We update or delete your data on request.</span></p>\\r\\n   <br>\\r\\n   <h2 dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:12pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">5. Website and social media visitors</span></h2>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">At the time of writing, we just use a Facebook, Instagram, or Twitter page as our way of sharing information about the group. Their servers hold links to those who “Liked” or “Shared” our pages, events etc. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Like most other organisations we might use Google Analytics on any website we establish. &nbsp;This records website visitors in the form of an advanced web server log. It archives:  </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">• &nbsp;What website you came from; </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">• How long you stay for; and </span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">• the kind of computer used. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">This helps us to understand the kind of people who come to our sites and what content they’re reading and enables us to make better decisions about web design and writing. &nbsp;</span></p>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">We occasionally compile aggregate statistics about numbers of site visitors and browsers being used. &nbsp;No personal data is included in this type of reporting and all this activity falls within the bounds of the&nbsp;</span><a href=\\\"http://www.google.com/analytics/tos.html\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(5, 99, 193); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\\\">Google Analytics Terms of Service</span></a><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">.</span></p>\\r\\n   <br>\\r\\n   <h2 dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:12pt;margin-bottom:3pt;\\\"><span style=\\\"font-size: 14pt; font-family: Dosis; color: rgb(171, 12, 23); background-color: transparent; font-weight: 600; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Your rights</span></h2>\\r\\n   <p dir=\\\"ltr\\\" style=\\\"line-height:1.44;margin-top:0pt;margin-bottom:6pt;\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(38, 38, 38); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">If you have any concerns, which are not resolved by communicating with us, you can raise a complaint with the Information Commissioner’s Office at </span><a href=\\\"http://www.ico.org.uk\\\"><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(31, 78, 121); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\\\">www.ico.org.uk</span></a><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(31, 78, 121); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\\\">.</span></p>\\r\\n   <div><span style=\\\"font-size: 12pt; font-family: &quot;Open Sans&quot;; color: rgb(31, 78, 121); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></div>\\r\\n</span>\"}');
INSERT INTO `global_settings` VALUES ('saferSpacesPolicy','{\"title\":\"Safer Spaces Policy\",\"markup\":\"\\r\\n                  \\r\\n                  <p class=\\\"mt-2\\\">SHRUB aims to provide a safe environment, which is welcoming, engaging and supportive for everyone. By becoming a member, you agree to behave in accordance with this policy when at SHRUB, during SHRUB events, and through SHRUB’s social media, emails or other messages with those involved with SHRUB!</p>\\r\\n\\r\\n            <p class=\\\"mt-2\\\">You will find a full verstion of the safer spaces policy in your welcome email, please take a look!</p>\\r\\n\\r\\n            <p class=\\\"mt-2\\\">You can also contact the welfare working group if you have any problems or require support: <a href=\\\"shrubwelfare@gmail.com\\\">shrubwelfare@gmail.com</a></p>\\r\\n              \\r\\n              \"}');
INSERT INTO `global_settings` VALUES ('volunteerAgreement','{\"title\":\"Volunteer Agreement\",\"markup\": \"<p>This agreement will act as a reminder of the support that SHRUB should offer you as a volunteer and the rights and responsibilities you have as a member of the SHRUB community.</p>\\n\\n            <p class=\\\"mt-2 mb-1\\\">The SHRUB has the responsibility:</p>\\n\\n            <div class=\\\"container\\\">\\n              <ul style=\\\"list-style-type: disc;\\\">\\n                <li>To provide adequate information and training so that you are able to meet the responsibilities of your volunteering role, (outlined in your Volunteer Role Description, or on agreement with your working group), this includes:</li>\\n                <div class=\\\"container\\\">\\n                  <ul style=\\\"list-style-type: disc;\\\">\\n                    <li>To support you throughout your time volunteering with SHRUB.</li>\\n                    <li>To assign you a named co-ordinator, who will act as a go-to-person for you.</li>\\n                    <li>To treat you with respect.</li>\\n                    <li>To be receptive to any comments and feedback from you and other volunteers.</li>\\n                    <li>To value and recognise your contribution as a volunteer.</li>\\n                  </ul>\\n                </div>\\n              </ul>\\n            </div>\\n\\n            <p class=\\\"mt-4 mb-1\\\">The Volunteer (you) has the responsibility:</p>\\n            <div class=\\\"container\\\">\\n              <ul style=\\\"list-style-type: disc;\\\">\\n                <li>To fulfil your role as outlined in your volunteer role description/by agreement with the working group.</li>\\n                <li>To follow SHRUB’s policies and procedures.</li>\\n                <li>To meet time and task commitment and provide sufficient notice when not available to meet your responsibilities.</li>\\n                <li>To treat any sensitive personal or business information and data, you may have access to as part of your role, as confidential and in line with the Data Protection Act.</li>\\n                <li>To act in a way that is in line with the aims, objectives, and ethos of the SHRUB.</li>\\n                <div class=\\\"container\\\">\\n                  <p>This means when interacting with people in the SHRUB: Be respectful, be aware of your own prejudices, create calm, and strive for equality and diversity.</p>\\n                  <p>Sexism, racism, homophobia and other behaviours and language that belittle or insult other people will not be tolerated within our organisation. If somebody is acting in a way that you feel uncomfortable with, either point it out to them or talk to a member of staff or the Welfare Working group.</p>\\n                  <p>The SHRUB is an inclusive space!</p>\\n                </div>\\n              </ul>\\n            </div>\\n\\n            <p class=\\\"mt-3 mb-1\\\">The volunteer (you) has the right:</p>\\n            <div class=\\\"container\\\">\\n              <ul style=\\\"list-style-type: disc;\\\">\\n                <li>To participate in the decision making process of the SHRUB by attending open meetings (see shrub website for dates and times).</li>\\n                <li>To participate in your Working Group and any other that you wish to.</li>\\n              </ul>\\n            </div>\\n\\n            <p class=\\\"mt-2\\\">If you are unable to meet your responsibilities (outlined above) SHRUB may ask you to step back from your volunteering role.</p>\"}');
