INSERT INTO `mail_templates` VALUES (0,'active_volunteer_survey','Sent to volunteers every 3 months','Volunteer Survey','<p>Hey, |first_name|!</p><p>You\'ve been volunteering with Shrub for (another) 3 months. We\'d appreciate it if you took the time to fill out <a href=\"%7Cquarterly_survey%7C\" target=\"_blank\">this survey</a>!</p><p>From Shrub x</p>\n                \n                \n                \n                \n                ','Hey, |first_name|!\n\nYou\'ve been volunteering with Shrub for (another) 3 months. We\'d appreciate it if you took the time to fill out [this survey](|quarterly_survey|)!\n\nFrom Shrub x');
INSERT INTO `mail_templates` VALUES (1,'donation','Sent once a donation has been processed.','Swap Shop: New tokens have been added to your account!','<p>Hi |first_name|,</p><p>Our volunteers have processed the items you recently dropped off at the Swap Shop and&nbsp;<span style=\"font-weight: bolder;\">|tokens| tokens</span>&nbsp;have been added to your account</p><p>You now have a total of |balance| tokens in your account.</p><p><br></p><p><span style=\"font-weight: bolder;\">How do we value your stuff?</span></p><p>Our volunteers sort through your items to check their condition and value the items we\'re able to sell in the shop.</p><p>Unlike your ordinary charity shop, we give you back 25% of your item\'s value. This is added to your account in the form of tokens that you can spend at the Swap Shop where 1 token is worth £1.</p><p>We\'re open 12pm to 5pm, Wednesday, Thursday, Friday, Saturday.</p><p><br></p><p>Thank you!</p><p>The Swap Shop</p>','Hi |first_name|,\r\n\r\nOur volunteers have processed the items you recently dropped off at the Swap Shop and |tokens| tokens have been added to your account\r\n\r\nYou now have a total of |balance| tokens in your account.\r\n\r\nHow do we value your stuff?\r\n\r\nOur volunteers sort through your items to check their condition and value the items we\'re able to sell in the shop.\r\n\r\nUnlike your ordinary charity shop, we give you back 25% of your item\'s value. This is added to your account in the form of tokens that you can spend at the Swap Shop where 1 token is worth £1.\r\n\r\nWe\'re open 12pm to 5pm, Wednesday, Thursday, Friday, Saturday.\r\n\r\nThank you!\r\n\r\nThe Swap Shop');
INSERT INTO `mail_templates` VALUES (1,'footer','Added to the end of all emails to members',NULL,'<p>This is an automatically generated email</p><p><a href=\"https://murakami.org.uk/contact-preferences/|membership_id|\">Update your contact preferences</a></p>','');
INSERT INTO `mail_templates` VALUES (0,'free_membership_reminder','Sent 6 weeks after a free member last volunteered','Your Free Membership Will Expire!','<p><strong>Hey |first_name|!</strong></p><p>We see you haven\'t volunteered in a while :-(</p><p>Your free membership will expire if you don\'t volunteer by |exp_date|. If your schedule has changed and you can no longer volunteer at least once every 2 months, feel free to pop in and become a paid member. If you don\'t feel like staying a member, that\'s ok - you can continue your membership at anytime (we\'ll retain your information for 2 years after expiration)</p><p>From Shrub Co-op</p>','Hey |first_name|!\n\nWe see you haven\'t volunteered in a while :-(\n\nYour free membership will expire if you don\'t volunteer by |exp_date|. If your schedule has changed and you can no longer volunteer at least once every 2 months, feel free to pop in and become a paid member. If you don\'t feel like staying a member, that\'s ok - you can continue your membership at anytime (we\'ll retain your information for 2 years after expiration)\n\nFrom Shrub Co-op');
INSERT INTO `mail_templates` VALUES (1,'goodbye','Sent when membership expires','Your Membership Expired','<p>We\'re sorry to see you go, |first_name|</p>','We\'re sorry to see you go, |first_name|');
INSERT INTO `mail_templates` VALUES (1,'hello','Sent when new member signs up (non-volunteer)','Welcome to Shrub!','<p>Hey, |first_name|!</p><p>Thanks for joining Shrub.</p><p>Love Shrub Co-op</p>','Hey, |first_name|!\n\nThanks for joining Shrub.\n\nLove Shrub Co-op');
INSERT INTO `mail_templates` VALUES (0,'hello_volunteer','Sent when new member signs up (interested in volunteering)','','<p>Hey, |first_name|!</p><p>Thanks for joining Shrub. We noticed you said you\'d be interested in volunteering with us. We\'d really appreciate it if you could fill out <a href=\"|new_vol_survey|\" target=\"_blank\">this survery</a> to help us get to know you! The survey will expire a month today.</p><p>Love Shrub Co-op</p>\n                \n                \n                \n                ','Hey, |first_name|!\n\nThanks for joining Shrub. We noticed you said you\'d be interested in volunteering with us. We\'d really appreciate it if you could fill out [this survery](|new_vol_survey|) to help us get to know you! The survey will expire a month today.\n\nLove Shrub Co-op');
INSERT INTO `mail_templates` VALUES (1,'membership_id_reminder','Reminds members of their unique ID','Your Membership ID','<p>Hey |first_name|,</p><p>Your unique membership ID is: |membership_id|</p>','');
INSERT INTO `mail_templates` VALUES (0,'renewal_notice_long','Sent 1 month before membership expires','Membership Renewal Reminder','<p><strong>Hey |first_name|!</strong></p><p>We\'d like to take the chance to thank you for your support over the past 12 months. As a cooperative our members involvement is extremely important and very much appreciated.</p><p>We understand you\'re busy and just wanted to take this time to remind you that your membership will expire on <strong>|exp_date|</strong>.</p><p>If you\'re still deciding whether or not to renew, or just haven\'t gotten around to it yet, please consider the important role our members play in setting the agenda for and supporting SHRUB\'s vision of a world without waste.</p><p>We would also like to remind you of the benefits of your membership.</p><p>With a Shrub co-op membership, you can:</p><ul><li>Support our vision of a world without waste and our work to create a circular economy</li><li>Bring in stuff you don\'t need and get swap tokens added to your account</li><li>Spend the tokens when you want on things you do need â€“ shop without money!</li><li>Get great free stuff in the Co-op Members\' Freeshop</li><li>Join co-op meetings and have a say in how the Shrub develops</li><li>Be part of an active community of change-makers</li><li>Member only monthly parties!</li></ul><p>We hope that you\'ll take this time to renew your membership and remain a part of our community. It couldn\'t be easier - just <a href=\"https://www.shrubcoop.org/become-a-member/\" target=\"_blank\">click here</a> to renew!</p><p>Kind regards,</p><p>Shrub Co-op</p>','Hey |first_name|!\n\nWe\'d like to take the chance to thank you for your support over the past 12 months. As a cooperative our members involvement is extremely important and very much appreciated.\n\nWe understand you\'re busy and just wanted to take this time to remind you that your membership will expire on |exp_date|.\n\nIf you\'re still deciding whether or not to renew, or just haven\'t gotten around to it yet, please consider the important role our members play in setting the agenda for and supporting SHRUB\'s vision of a world without waste.\n\nWe would also like to remind you of the benefits of your membership.\n\nWith a Shrub co-op membership, you can:\n\n- Support our vision of a world without waste and our work to create a circular economy\n- Bring in stuff you don\'t need and get swap tokens added to your account\n- Spend the tokens when you want on things you do need â€“ shop without money!\n- Get great free stuff in the Co-op Members\' Freeshop\n- Join co-op meetings and have a say in how the Shrub develops\n- Be part of an active community of change-makers\n- Member only monthly parties!\n\nWe hope that you\'ll take this time to renew your membership and remain a part of our community. It couldn\'t be easier - just [click here](https://www.shrubcoop.org/become-a-member/) to renew!\n\nKind regards,\n\nShrub Co-op');
INSERT INTO `mail_templates` VALUES (0,'renewal_notice_short','Sent 1 week before membership expires','Membership Renewal Reminder','<p><strong>Hey |first_name|!</strong></p><p>We\'d like to take the chance to thank you for your support over the past 12 months. As a cooperative our members involvement is extremely important and very much appreciated.</p><p>We understand you\'re busy and just wanted to take this time to remind you that your membership will expire in one week\'s time (<strong>|exp_date|</strong>).</p><p>If you\'re still deciding whether or not to renew, or just haven\'t gotten around to it yet, please consider the important role our members play in setting the agenda for and supporting SHRUB\'s vision of a world without waste.</p><p>We would also like to remind you of the benefits of your membership.</p><p>With a Shrub co-op membership, you can:</p><ul><li>Support our vision of a world without waste and our work to create a circular economy</li><li>Bring in stuff you don\'t need and get swap tokens added to your account</li><li>Spend the tokens when you want on things you do need - shop without money!</li><li>Get great free stuff in the Co-op Members\' Freeshop</li><li>Join co-op meetings and have a say in how the Shrub develops</li><li>Be part of an active community of change-makers</li><li>Member only monthly parties!</li></ul><p>We hope that you\'ll take this time to renew your membership and remain a part of our community. It couldn\'t be easier - just <a href=\"https://www.shrubcoop.org/become-a-member/\" target=\"_blank\">click here</a> to renew!</p><p>Kind regards,</p><p>Shrub Co-op</p>','Hey |first_name|!\n\nWe\'d like to take the chance to thank you for your support over the past 12 months. As a cooperative our members involvement is extremely important and very much appreciated.\n\nWe understand you\'re busy and just wanted to take this time to remind you that your membership will expire in one week\'s time (|exp_date|).\n\nIf you\'re still deciding whether or not to renew, or just haven\'t gotten around to it yet, please consider the important role our members play in setting the agenda for and supporting SHRUB\'s vision of a world without waste.\n\nWe would also like to remind you of the benefits of your membership.\n\nWith a Shrub co-op membership, you can:\n\n- Support our vision of a world without waste and our work to create a circular economy\n- Bring in stuff you don\'t need and get swap tokens added to your account\n- Spend the tokens when you want on things you do need - shop without money!\n- Get great free stuff in the Co-op Members\' Freeshop\n- Join co-op meetings and have a say in how the Shrub develops\n- Be part of an active community of change-makers\n- Member only monthly parties!\n\nWe hope that you\'ll take this time to renew your membership and remain a part of our community. It couldn\'t be easier - just [click here](https://www.shrubcoop.org/become-a-member/) to renew!\n\nKind regards,\n\nShrub Co-op');
INSERT INTO `mail_templates` VALUES (0,'renewed','Sent when member renews their membership','You Renewed Your Membership!','<p>Hey, |first_name|!</p><p>Thanks for renewing your membership with us!</p><p>Shrub Co-op</p>','Hey, |first_name|!\n\nThanks for renewing your membership with us!\n\nShrub Co-op');
INSERT INTO `mail_templates` VALUES (1,'welcome_volunteer','Sent when volunteer signs up.','Welcome to your new volunteer role','<p>Hey,<br><br>Thanks for becoming a volunteer with Shrub Co-op blah blah blah</p><p><br></p><p>General volunteer stuff, warm welcomes etc. etc.</p><p><br></p><p>|wg_summary|</p><p><br></p><p><b>Your Roles</b><br>|roles|</p><p><br></p><p>Regards,<br>Shrub Coop</p>','');
